  true,\n\t\"url\": null,\n\t\"notes\": \"The sample scenarios provided here are competition
  scenarios from Diagnostic Problems I and II of DXC'10. The zip file has a spreadsheet
  (and pdf) that lists the scenarios and relevant fault information. Each scenario
  is provided in three formats: tab-delimited .txt file, Matlab .mat file, and tab-delimited
  .scn file. The different formats are provided for your convenience; they have the
  same data. The scenario (.scn) files are the format read by the DXC framework. See
  the system catalogs and schematics for additional information.rnrnFor those involved
  in last year's competition, note that DXC'10 Diagnostic Problem I competition data
  posted last year (dated 20101105) had some problems which were fixed in the DPI
  sample data set posted here. The battery \"AbruptParasiticLoad\" scenario (Exp.
  1311) was removed as it was found to have different behavior prior to fault injection
  than nominal scenarios. Exp 1229_015f was too short (224 seconds) and was removed.
  Several runs caused an issue when a value was expected to be a real but was interpreted
  as an integer in the framework (1251, 1285, 1316, 1323, and 1330); this has been
  fixed.rnrnThere are no \"AbruptParasiticLoad\" faults in the DXC11 DPI competition
  data. \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
